aht.texts.getMGURL=function(curRef,bookData,mgType,includeEn){if(bookData.bookset&&(bookData.bookset=='Mishna MS Kaufmann'||bookData.bookset.startsWith('Yerushalmi MS ')||bookData.bookset.startsWith('Bavli MS ')||bookData.bookset.startsWith('Bavli Printing '))){bookData=JSON.parse(JSON.stringify(bookData));delete bookData.branch;bookData.commentator=bookData.bookset;}var url='',isParshan=bookData.branch!='auto'&&!bookData.isParashah;if(curRef.segments&&aht.texts.getLang(curRef.segments[0])=='he'){if(!curRef.titleInLangs||!curRef.titleInLangs.en)aht.texts.ref.setTitleInLangs('',curRef);curRef=aht.texts.ref.parse(curRef.titleInLangs.en);if(!curRef.book)return false;}if(bookData.commentator=='Rambam'||bookData.base=='Tur'||bookData.base=='Shulchan Arukh')url+=bookData.categories[2];else if(isParshan){url+='SP/';if(mgType=='Tur'||mgType=='ShulchanArukh'){$.each(aht.texts.turBooks,function(i,book){var posBookName=curRef.book.indexOf(book);if(posBookName!=-1){url+=curRef.book.substr(0,posBookName-1)+'/'+book;return false;}});}else{var parshan;if(bookData.commentator)parshan=bookData.commentator;else parshan=curRef.book;if(mgType=='Tanakh'&&aht.texts.mgExcludesTanakhParshan(parshan))return false;url+=parshan;if(bookData.parashahBookMark)url+='/'+bookData.parashahBookMark;else url+='/'+bookData.categories[2];}}else url+=curRef.book.replace(/^(Mishna|Tosefta|Bavli|Yerushalmi|Rif) /,'');if(curRef.segments&&typeof curRef.segments[2]!='undefined'){url+=('/'+curRef.segments[2]).replace(',','');if(typeof curRef.segments[3]!='undefined'&&curRef.segments[3]!='')url+='.'+curRef.segments[3];}else if(!bookData.isParashah&&!bookData.parashahBookMark)url+='/0';if(includeEn)url+='$$e'+(isParshan?2:1);return url;}
